Hibernate OGM ~ Discriminating Polymorphic Objects (Abstract Superclasses)<p>I have a data model for MongoDB in Java that uses abstract superclasses to discriminate between polymorphic objects like this:</p>
<pre><code>[Object that gets saved in the database]
└[List&lt;AbstractSuperclass&gt;]
 ├[SubclassA extends AbstractSuperclass]
 ├[SubclassB extends AbstractSuperclass]
 ├[SubclassA extends AbstractSuperclass]
 ├[SubclassC extends AbstractSuperclass]
 ├[SubclassC extends AbstractSuperclass]
 └[SubclassD extends AbstractSuperclass]
</code></pre>
<p>When I'm just using Java MongoDB Driver, that works just fine if I use the <code>@BsonDiscriminator</code> annotation.</p>
<p>However, I have not yet been able to get this to work with Hibernate. I have tried various annotations, all of which have produced various degrees of fail. Among the things I've tried are:</p>
<ul>
<li><code>@AbstractSuperclass</code></li>
<li><code>@DiscriminatorColumn</code> and <code>@DiscriminatorValue</code></li>
<li><code>@OneToMany</code></li>
</ul>
<p>I may have done it wrong though, so feel free to suggest any of the above if you think it will solve the problem.</p>
<p>To easily reproduce the situation, I have created a simple sample project that replicates the data structure in a simplified way and manages to reproduce the issue:</p>
<p>Let the GameCharacter class be the object I want to store with all its children. As I understand it, that means that the GameCharacter should be the only <code>@Entity</code> here, since all other objects exist only in regards to the GameCharacter.</p>
<pre><code>@Entity
public class GameCharacter {
    @Id
    public String _id;
    public String name;
    public Weapon weapon;
    public Armor armor;
    @OneToMany
    public List&lt;Item&gt; inventory;

    public GameCharacter() {

    }

    public GameCharacter(String name, Weapon weapon, Armor armor, String _id, List&lt;Item&gt; inventory) {
        this._id = _id;
        this.name = name;
        this.weapon = weapon;
        this.armor = armor;
        this.inventory = inventory;
    }
}
</code></pre>
<p>Let Item be an abstract superclass of inventory items.</p>
<pre><code>@BsonDiscriminator
@Entity
@DiscriminatorColumn(name=&quot;ITEM_TYPE&quot;)
public abstract class Item {
    @Id
    public String name;
    public int amount;

    public Item() {

    }

    public Item(String name, int amount) {
        this.name = name;
        this.amount = amount;
    }
}
</code></pre>
<p>Let Potion be one of several potential classes filling up the inventory and inheriting from the abstract Item class.</p>
<pre><code>@Embeddable
@DiscriminatorValue(&quot;POTION&quot;)
public class Potion extends Item {

    public Potion() {
    } 

    public Potion(String name, int amount) {
        super(name, amount);
    }
}
</code></pre>
<p>The above code samples are the closest I've come to a working solution. That way, at least Hibernate OGM can save and read from the database. However, it does not save them correctly, for upon inspecting the data in the MongoDB, it turns out to be this:</p>
<pre><code>_id:&quot;sylv01&quot;
weapon:Object
    [...]
name:Sylvia the Hero
armor:Object
    [...]
inventory:Array
    0:Hi-Potion
    1:Mega Ether
</code></pre>
<p>...wheras it should be this (saved by Java MongoDB Driver):</p>
<pre><code>_id:&quot;sylv01&quot;
weapon:Object
    [...]
name:Sylvia the Hero
armor:Object
    [...]
inventory:Array
    0:Object
        _t:&quot;dataObjects.Potion&quot;
        amount:3
        name:&quot;Hi-Potion&quot;
    1:Object
        _t:&quot;dataObjects.Ether&quot;
        amount:5
        name:&quot;Mega Ether&quot;
</code></pre>
<p>I assume that this might be due to me having to annotate <code>Item</code> as an <code>@Entity</code>, even though in my data model it really is more of an <code>@Embeddable</code> or an <code>@AbstractSuperclass</code>. However, if I do that, and maybe switch out the <code>@OneToMany</code> annotation in the <code>GameCharacter</code> for <code>@ElementCollection</code>, which I feel would be more fitting, I get errors like:</p>
<ul>
<li>javax.persistence.PersistenceException: org.hibernate.InstantiationException: Cannot instantiate abstract class or interface:  : dataObjects.Item</li>
<li>org.hibernate.MappingException: Could not determine type for: dataObjects.Item, at table: GameCharacter_inventory, for columns: [org.hibernate.mapping.Column(inventory)]</li>
</ul>
<p>Anyway, here's a test case that currently fails with the above setup:</p>
<pre><code>    @Test
    void writeAndReadShouldSaveInventoryCorrectly() throws SecurityException, IllegalStateException, NotSupportedException, SystemException, HeuristicMixedException, HeuristicRollbackException, RollbackException {

        GameCharacter sylvia = GameCharacters.sylvia();

        OgmAccessor.write(sylvia, entityManagerFactory);

        transactionManager.begin();
        GameCharacter loadedGameCharacter
            = entityManager.find(GameCharacter.class, sylvia._id);
        transactionManager.commit();

        int actualInventorySize = loadedGameCharacter.inventory.size();
        assertEquals(2, actualInventorySize);
    }
</code></pre>
<p>This test currently crashes with the following error:</p>
<pre><code>    javax.persistence.EntityNotFoundException: Unable to find dataObjects.Item with id Hi-Potion
</code></pre>
<p>...which I assume is because I had to make the Inventory Items an <code>@Entity</code> to get this far.</p>
<p>However, what I actually want is a solution where everything related to the GameCharacter gets saved when I commit the GameCharacter, as the children-objects it contains have no meaning outside the GameCharacter and it thus does not make sense for them to exist as separate entities.</p>
<p>I get the feeling that I'm close to the solution, but I can't figure out what I'm doing wrong here and where. As such, any input would be greatly appreciated.</p>
<hr />
<p>EDIT:</p>
<p>The dependencies I am using in my project are:</p>
<pre><code>plugins {
    id 'java-library'
}

repositories {

    jcenter()
}

dependencies {
    // Use JUnit test framework
    testCompile(&quot;org.junit.jupiter:junit-jupiter:5.6.0&quot;)
    testCompile(&quot;org.junit.platform:junit-platform-runner:1.6.0&quot;)

    //MongoDB Driver
    compile 'org.mongodb:mongodb-driver:3.6.0'
    compile 'commons-logging:commons-logging:1.2'

    //Logging
    compile 'log4j:log4j:1.2.17'
    compile 'org.slf4j:slf4j-log4j12:1.7.25'
    compile 'commons-logging:commons-logging:1.2'

    //Versioning
    compile group: 'org.hibernate.ogm', name: 'hibernate-ogm-mongodb', version: '5.4.0.Final'
    compile group: 'org.jboss.narayana.jta', name: 'narayana-jta', version: '5.9.2.Final'
    compile group: 'javax.xml.bind', name: 'jaxb-api', version: '2.3.0'
}

</code></pre>
<hr />
<p>EDIT:</p>
<p>I added this to a public github repository, so anyone who is interested can try and see if he finds a working version. The test project also contains a configuration for a MongoDB Docker Container that can be started using <code>docker-compose up</code> in the folder <code>/mongo_db</code>.</p>
<p><a href="https://github.com/Kira-Cesonia/MongoDBVersioningTest" rel="nofollow noreferrer">https://github.com/Kira-Cesonia/MongoDBVersioningTest</a></p>

